export const setTemperature = temperature => ({
    type: "SET_TEMPERATURE",
    temperature: temperature
  });

export function getTemperature() {
  return dispatch => {
    fetch("http://localhost:5000/temperature")
      .then(temp => {
        console.log(temp)
        //dispatch(setTemperature(data.temperature));
      });
  }
}
